import React from "react";
import MessageCard from "./messagecard";

class MessageList extends React.Component {
  render() {
    return (
      <div>
        <MessageCard message={`eae man`} /> <br />
        <MessageCard message={`eae lok`} />
        <MessageCard message={`blz?`} />
        <MessageCard message={`blz e vc`} />
        <MessageCard message={`sereno`} />
      </div>
    );
  }
}

export default MessageList;
